import React from "react";
import { Route, Routes, Switch, Redirect } from "react-router-dom";
import { Fragment } from "react/cjs/react.production.min";
import Home from "./Pages/HomePage";

function App() {
  return (
    <Fragment>
      <Routes>
        <Switch>
          <Route path="/">
            <Redirect to="/Home"></Redirect>
          </Route>
          <Route path="/Home" exact element={<Home></Home>}></Route>
          <Route path="/KnowMore" exact element={<h1>KnowMore</h1>}></Route>
        </Switch>
      </Routes>
    </Fragment>
  );
}

export default App;
